import "./App.css";
import { Route, Routes } from "react-router";
import Edit from "./pages/Edit";

function App() {
  return (
    <>
      <Routes>
        <Route path="/edit" element={<Edit />} />
        <Route path="/preview" element={<div></div>} />
      </Routes>
    </>
  );
}

export default App;
